fun main() {
    val actions = input.split('\n')

//    actions.flatMap {
//        it.trim('[', ']').split(',').map { t -> t.trim('"') }
//    }.toSet().sorted().forEach { println(it) }

    actions.forEach {
        val s = it.trim('[', ']').split(',').map { t -> t.trim('"') }
        var minNew = Int.MAX_VALUE
        var minOld = Int.MAX_VALUE
        var newAction = Int.MAX_VALUE

        for ((i, t) in s.withIndex()) {
            if (t in newActions)
                minNew = minOf(i, minNew)

            if (t in oldActions)
                minOld = minOf(i, minOld)

            if (t == "business_delete_app")
                newAction = minOf(i, newAction)
        }

        if (newAction == Int.MAX_VALUE)
            println("business_delete_app not found")
        else if (minOld < newAction)
            println("protected by existing actions")
        else if (minNew < newAction)
            println("protected by new actions")
        else
            println("business_delete_app opportunity!")
    }
}